import React, { useState } from 'react';
import DropdownMoore from '../Components/Sidebar/DropdownMoore.js';
import { Icon } from '../icon';


const More = () => {

    const [show, setShow] = useState(false)

    return (
        <>
            <button type='button' className='px-3 py-3 mb-[2px] rounded-3xl duration-150 ease-linear flex items-center text-link gap-x-4 font-normal group hover:bg-linkHover'
                onClick={() => setShow(show => show)}
            >
                <div className='group-hover:scale-[1.1] duration-150'>
                    <Icon name="more" />
                </div>
                <span>Daha Fazla</span>
            </button>
            <DropdownMoore />
        </>
    );
};

export default More;
